import React from 'react'
import data from "./data.json"

function ProformaItem(){
    const show = data.map(
        (data)=>{
            return(
                <tr>
                    <td>{data.product_id}</td>
                </tr>
            )
        }
    )

    return(
        <div>
            <table className="table table-striped">
                <thead>
                    <tr>
                        <th>
                            Product ID
                        </th>
                    </tr>
                </thead>
                <tbody>
                    {show}
                </tbody>
            </table>
        </div>
    )
}
export default ProformaItem
